INSERT INTO `eku122x_video` (`id`, `nexusphp`, `videoname`, `cid`, `title`, `intro`, `keywords`, `color`, `actor`, `director`, `content`, `picurl`, `area`, `language`, `year`, `serial`, `addtime`, `hits`, `monthhits`, `weekhits`, `dayhits`, `hitstime`, `stars`, `status`, `up`, `down`, `playurl`, `downurl`, `inputer`, `reurl`, `letter`, `score`, `scoreer`, `genuine`, `vodplay`, `stype_mcid`, `selftitle`, `selfkeywords`, `selfdescription`) VALUES
(1, 1, '[106].大白鲨.jaws.1975.HDTV.MiniSD-TLF.mkv', 12, '大白鲨', '', '', '', '罗伊·施奈德 罗伯特·肖 理查德·德莱弗斯 洛兰·加里', '史蒂文·斯皮尔伯格', '艾米蒂岛是一个旅游度假胜地，有大批的游客来这里游泳。然而，大白鲨的出现却改变了这一切。事故从一对情侣开始，他们下海游泳，女的不幸成为了第一个牺牲者，支离破碎的尸体令人惨不忍睹。当地官员却不愿意封场调查，他们怕影响旅游收入，于是请来了生物学家布朗（理查德•德莱福斯 Richard Dreyfuss　饰）。\r\n布朗断定，这是一只非比寻常的巨大白鲨。他的提醒并没有引起当局的足够重视，紧接着又有人死于非命，事态才变得越发严重。当地一个熟练捕鱼手、警察和布朗一共三人，决心要捕杀大白鲨，凶险重重的搏斗开始了，谁才是最后的胜者？要获得这场战斗的胜利，又要付出怎样的代价？©豆瓣', '/video/1.jpg', '美国', '国语', 1975, '0', 1377602753, 0, 0, 0, 0, 0, 1, 1, 0, 0, '第一集', '', '', '', 'D', 0.0, 1, 0, 'v6', '17,25', '', '', ''),
(2, 2, '', 10, '别跟我谈高富帅', '', '', '', '王聪 甘露 啜妮 宋哲', '张一墨', '富家女白露（甘露 饰）不满父母一直安排自己与高富帅陈蔚然的婚姻，一气之下与闺蜜叶晓琪（艾晓琪 饰）开车出游散心。没想到接连遭遇天外飞筐和崴脚事件，从而结识了“臭流氓”李小憨（王聪 饰）和“特种炊事兵”孙大海。白富美是否真的只能选择高富帅，还是在旅途中寻到真爱？', '/video/2.jpg', '中国大陆', '', 2013, '0', 1377606204, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(3, 3, '', 11, '鬼童院/ 恶魔的脊椎骨/ 魔童魅影', '', '', '', '费尔南多·提尔弗 爱德华多·诺列加 费德里科·路皮 玛丽莎·佩雷德斯', '吉尔莫·德尔·托罗', '1939年，持续三年的西班牙内战接近尾声，右翼法西斯分子风头正劲。左派战争孤儿卡洛斯（费尔南多·缇艾弗 Fernando Tielve 饰），被父亲的战友们送到一个位于荒郊野外的孤儿院。这个孤儿院由严厉的卡门女士（玛丽莎·佩雷德斯 Marisa Paredes 饰）和和蔼的卡萨瑞斯教授（Federico Luppi 饰）共同经营。卡洛斯离开亲人和叔叔们的失落情绪并未持续太久，他很快就融入了这个满是同龄人的大家庭。不过，这个院子中央插着炮弹的地方，也许原本就存在着些许异常。卡洛斯所睡的12号床之前属于一个名叫山迪的孩子，山迪在不久前离奇死去。自从卡洛斯来之后，那个小男孩的鬼魂便不断出现……\n本片荣获2002年阿姆斯特丹奇幻电影节评委会银奖；2002年法国Gérardmer电影节国际影评人奖、评委会特别奖和青年评委会奖；2002年青年艺术家奖最佳演员奖（Fernando Tielve）。©豆瓣', '/video/3.jpg', '西班牙', '', 2001, '0', 1377617049, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '31', NULL, NULL, NULL),
(4, 4, '[凶灵假期].Long.Weekend.2013.BluRay.720p.x264.AC3.2Audios-CMCT.mkv', 12, '凶灵假期/幽长周末(台)', '', '', '', 'Natpassara Adulyamethasiri Nott Acharanat Ariyaritwikol Chinawut Indracusin Sheranut Yusananda', 'Taweewad Wantaa', '楠、仔等五名青年男女利用假期外出度假，他们来到一个地处偏远山区、几乎与世隔绝的小岛别墅，宽敞华丽的大房子以及秀丽原始的自然风光令他们欣喜过望，乐享其中。在此期间，连一向举止言行有些怪异的康树（Chinawut Indracusin 饰）也跟了过来。当然，康树成为男孩们嘲弄戏谑的对象。当地流传着极为恐怖的传说，不过对于寻求刺激的年轻人来说，这才是他们旅行乐趣之所在。他们辗转来到一座气氛阴森诡异的废墟，不顾康树的警告与劝阻，众人径直走了进去，男孩们更将康树锁进黑漆漆的窑洞里。\n放肆玩乐的次日，楠担心康树的安危，却发现这个从童年时代便曾有过诡异经历的男孩神秘失踪，而恐怖的体验也就此展开……©豆瓣', '/video/4.jpg', '泰国', '', 2013, '0', 1377620843, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '31', NULL, NULL, NULL),
(5, 5, 'Pain.and.Gain.2013.720p.BluRay.X264-AMIABLE.mkv', 8, '付出与收获/甜从苦中来/健男抢钱团(台)', '', '', '', '马克·沃尔伯格 道恩·强森 艾德·哈里斯 托尼·夏尔赫布', '迈克尔·贝', '《付出与收获》根据健美先生的真实故事改编而成，马克和岩石饰演的两位健美先生无辜卷入了一场敲诈勒索的勾当，可阴差阳错竟然演变成了绑票谋杀案。\n丹尼尔·鲁果是一个健美教练，他在一家名为太阳健身馆的地方工作，那里有他的收入、他的事业和他的朋友艾德里安·道波尔。但是健美教练的生活并没有人们想象的那么轻松和光鲜。为了维持自己的身材，他们必须时刻训练，而且还要吃掉不少昂贵的药品，甚至还要注射。所以，丹尼尔的生活非常贫困。\n穷则思变，丹尼尔想到了一个抢劫的点子，他准备下手的目标是常来健身馆的维克多·克绍，他是一个富裕的商人。只要对他稍加折磨，大笔的现金就会流入自己的口袋。不过，要干这一票，凭着自己的能力还是不够的，所以丹尼尔找来了另一个刑满释放人员保罗·道伊尔来帮助自己实施抢劫的计划。\n其实，这群健身教练的计划执行得非常成功，钱也搞到手了，警察也抓了瞎。但是维克多·克绍却并不想就此罢休，他找来了私家侦探艾德·波利斯，让他来调查警方没有查明的真相……', '/video/5.jpg', '美国', '', 2013, '0', 1377621019, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(6, 6, 'The.Descent.2005.720p.BluRay.x264.DTS-WiKi.Sample.mkv|The.Descent.2005.720p.BluRay.x264.DTS-WiKi.mkv', 12, '黑暗侵袭/魔洞(港)/深入绝地(台)', '', '', '', '肖娜·麦克唐纳德 娜塔莉·杰克逊·门多萨 Alex Reid 萨斯基亚·马尔德', '尼尔·马歇尔', '莎拉（肖娜·麦克唐纳 饰）本来平静幸福的生活被一次车祸意外打破，丈夫和女儿在事故中丧生，她虽然活了下来却从此一蹶不振，为了让莎拉重新振作起来，她的五个女性朋友为她安排了一次探险旅行，地点是在一个丛林中荒僻而古老洞穴，茹诺(娜塔丽·杰克逊·门多萨 饰)是其中最有野外探险经验也是她选择来到这里。正当女孩们对山洞中景色惊叹不已时，却在不知不觉中惊扰了洞中另外一种生物，他们没有视觉，依靠声音的来源残忍的捕杀她们，女孩们为了自救团结起来，却在逃生中朋友间互生怀疑，为了生存下去，她们要如何在狭小黑暗的洞穴中找到出去的路呢？©豆瓣', '/video/6.jpg', '英国', '', 2005, '0', 1377623428, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17', NULL, NULL, NULL),
(7, 7, '致我们终将逝去的青春.HD.mkv', 10, '致我们终将逝去的青春', '', '', '', '杨子姗 赵又廷 韩庚 江疏影', '赵薇', '18岁的郑微（杨子姗 饰）终于如愿考上青梅竹马邻家大哥哥林静（韩庚 饰）所在学校的邻校，等她满怀期冀地步入大学校园，却遭遇打击——林静出国留学，杳无音信。郑微倍感失落，患难时刻与室友阮莞（江疏影 饰）、朱小北（刘雅瑟 饰）、黎维娟（张瑶 饰）及师哥老张-张开（包贝尔 饰）结 下深厚友谊，同时富家公子许开阳（郑恺 饰）对郑微展开了疯狂的追求，而备受男生欢迎的阮莞用她特有的清冷守护着对于心爱人赵世永（黄明 饰）的忠贞。一次偶然的误会使郑微与老张室友陈孝正（赵又廷 饰）结为死敌，在一次次地反击中，郑微发现自己爱上了这个表面冷酷、内心善良的高材生，于是疯狂地反击演变为死缠烂打地追求，而陈孝正也终于在强攻之下缴械投降，欢喜冤家终成甜蜜恋人。大四毕业之际郑微的生活再次经受考验：陈孝正得到曾毓（王嘉佳 饰）的出国留学名额，却迟迟不敢告诉郑微，感觉再次被欺骗的郑微痛苦地离开陈孝正……\n多年后，郑微已蜕变为职场上的白领丽人，竟再次品尝命运的无常：带着悔意和爱意的林静和陈孝正同时回到她的生活里！郑微，这个昔日的玉面小飞龙，将怎样面对生活和青春赐予她的迷雾和抉择……\n本片改编自辛夷坞同名畅销小说。赵薇的首部导演作品，也是其在北京电影学院导演系研究生专业的毕业作品。©豆瓣', '/video/7.jpg', '中国大陆', '', 2013, '0', 1377624447, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(8, 8, '[彗星美人].All.About.Eve.1950.720p.BluRay.x264-SiNNERS.mkv', 12, '彗星美人', '', '', '', '贝蒂·戴维斯 安妮·巴克斯特 乔治·桑德斯 西莱斯特·霍姆', '约瑟夫·L·曼凯维奇', '百老汇资深女星玛戈·强尼（贝蒂·戴维斯 Bette Davis饰）即便上了年纪，却仍风姿绰约，是百老汇炙手可热的殿堂级名角。成功的演艺生涯，光鲜亮丽的生活圈子，一切看起来都如此完美。直到她的剧作家朋友劳埃德·理查兹（休·马洛威 Hugh Marlowe饰）和妻子卡伦（西莱斯特·霍姆 Celeste Holm饰），把面目清秀、聪明怜俐的艾娃·哈林顿（安妮·巴克斯特 Anne Baxter饰）介绍给她做跟班，玛戈才意识到这个潜心学艺进步飞快的姑娘对自己的威胁，不免起了戒心。与此同时，艾娃极力讨好大名鼎鼎的剧评家艾德逊·德威特（乔治·桑德斯 George Sanders饰），势要在百老汇找到自己的一席之地。\n本片荣获1951年第23届奥斯卡金像奖最佳影片、最佳导演、最佳男配角等6项大奖，14项奥斯卡提名。该片至今仍保持着荣获奥斯卡提名数量最高的纪录。影片故事先后于1970年被改编成百老汇音乐剧《Applause》，1973年还被拍成电视电影《Applause》。©豆瓣', '/video/8.jpg', '美国', '', 1950, '0', 1377626134, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(9, 9, 'CHC.Born.To.Love.You.2013.HDTV.720p.x264-CHDTV.mkv', 10, '大叔我爱你', '', '', '', '张智霖 付梦妮 翁虹 野营', '胡崇曦', '十八岁的“红星社二代”乐队主唱沈绮（付梦妮 饰），在一起事故中，与刚从香港归来的风度翩翩中年男子方家成（张智霖 饰）一眼投缘。方家成为了在母亲面前隐瞒在香港失业无奈回到上海的秘密，瞬念之间“绑架”了沈绮当自己女友。情窦初开不识风情的沈绮，就此一发不可收拾，酒吧买醉，江边狂呼，现场邀唱，死乞白赖，萝莉不善爱情，只能真情呼唤。方家成似乎有所回应，却又犹豫不决，毕竟一段二十年前的回忆不断困扰，无法释怀，情何以堪。就在沈绮死了念想决然去澳洲念书的时候，一个从黄浦江里捞上来的旧箱子，揭开了一段非凡时空的秘密……©豆瓣', '/video/9.jpg', '中国大陆', '', 2013, '0', 1377627512, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(10, 10, 'Iron.Man.3.2013.720p.WEB-DL.Eng.HDCLUB.mkv', 8, '钢铁侠3/钢铁人3(台)/铁甲奇侠3(港)/铁人3', '', '', '', '小罗伯特·唐尼 盖·皮尔斯 格温妮斯·帕特洛 本·金斯利', '沙恩·布莱克', '自纽约事件以来，托尼·斯塔克（小罗伯特·唐尼 Robert Downey Jr. 饰）为前所未有的焦虑症所困扰。他疯狂投入钢铁侠升级版的研发，为此废寝忘食，甚至忽略了女友佩珀·波茨（格温妮斯·帕特洛 Gwyneth Paltrow 饰）的感受。与此同时，臭名昭著的恐怖头目曼达林（本·金斯利 Ben Kingsley 饰）制造了一连串的爆炸袭击事件，托尼当年最忠诚的保镖即在最近的一次袭击中身负重伤。未过多久，托尼、佩珀以及曾与他有过一面之缘的女植物学家玛雅（丽贝卡·豪尔 Rebecca Hall 饰）在家中遭到猛烈的炮火袭击，几乎丧命，而这一切似乎都与22年前那名偶然邂逅的科学家阿尔德里奇·基连（盖·皮尔斯 Guy Pearce 饰）及其终极生物的研究有关。\n即使有精密先进的铠甲护身，也无法排遣发自心底的焦虑。被击碎一切的托尼，如何穿越来自地狱的熊熊烈火……©豆瓣', '/video/10.jpg', '美国', '', 2013, '0', 1377628055, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(11, 11, 'The.Divide.2011.BluRay.iPad.720p.AAC.x264-CHDPAD.mp4', 12, '隔绝', '', '', '', 'Michael Biehn Milo Ventimiglia Lauren German Rosanna Arquette', '泽维尔·吉恩斯', '纽约市一场灾难性的核爆炸后，乔什（米洛·文提米利亚 Milo Ventimiglia 饰）、米奇（迈克尔·比恩 Michael Biehn 饰）、玛丽琳（罗姗娜·阿奎特 Rosanna Arquette 饰）、萨姆（罗姗娜·阿奎特 Rosanna Arquette 饰）、达尔文（考特尼·万斯 Courtney B. Vance 饰）、伊娃（劳伦·日尔曼 Lauren German 饰）、艾德里安（阿什顿·霍尔莫斯 Ashton Holmes 饰）、波比（迈克尔·艾克朗德 Michael Eklund 饰）这8个陌生人躲进了一座公寓大楼的地下室中。突然一群身着核生化防护服的武装人员出现，掳走了幸存者中的小女孩并准备要杀死剩下的所有人，幸存者们反抗并杀死了武装人员。但地下室的大门被武装人员从外面封死了，人们被困在了地下室中。随着时间的流逝，幽闭恐惧症让这次从避难所变成了牢笼人们开始绝望，已经开始心理扭曲，做出了一些常人难以想象的的事……©豆瓣', '/video/11.jpg', '德国', '', 2011, '0', 1377629428, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '24,25', NULL, NULL, NULL),
(12, 12, 'Switch.2013.1080p.WEB-DL.x264.AAC-XLMV.mkv', 8, '天机·富春山居图', '', '', '', '刘德华 林志玲 张静初 佟大为', '孙健君', '元代画家黄公望的名作《富春山居图》，被誉为“中国十大传世名画”之一。由于种种原因，该作的“无用师卷”和“剩山图”分处海峡两岸，隔海相望。2011年，《富春山居图》有望合璧展出，谁知这件保额即高达十亿的旷世杰作引来各国罪犯的觊觎。早些时候，“无用师卷”在台湾失窃，先失一着的日本文物走私大鳄山本俊雄（佟大为 饰）遂将目标锁定在深藏杭州的“剩山图”。与此同时，国内的老佛爷（斯琴高娃 饰）及欧美等国的文物贩子纷纷云集于此，蠢蠢欲动。在利欲薰心、刀光剑影的轮番交手中，香港警署海外缉私科特工肖锦汉（刘德华 饰）和身份莫辨的王雪晴（林志玲 饰）携手，与山本为首的走私犯周旋世界各个角落，接连过招，命悬一线。\n合璧展出之日逼近，国宝的命运难以勘破……©豆瓣', '/video/12.jpg', '中国大陆', '', 2013, '0', 1377631106, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17', NULL, NULL, NULL),
(13, 13, 'The.Haunting.in.Connecticut.2.Ghosts.of.Georgia.2013.720p.BluRay.x264-WiKi.Sample.mkv|The.Haunting.in.Connecticut.2.Ghosts.of.Georgia.2013.720p.BluRay.x264-WiKi.mkv', 12, '太平间闹鬼事件2：佐治亚鬼屋事件', '', '', '', '凯缇·萨克霍夫 查德·迈克尔·墨瑞 阿比盖尔·斯宾赛 艾米丽·阿琳·林德', '汤姆·艾尔金斯', '1993年，拥有幸福美满家庭的丽萨·威瑞克（阿比盖尔·斯宾赛 Abigail Spencer 饰）精神饱受折磨，她的家族患有遗传病症，她和姐姐乔希（凯缇·萨克霍夫 Katee Sackhoff 饰）都能看到奇怪的景象，去世母亲的身影时时出现在她面前，声称要告诉她一些事情。为了帮助妻子治疗，丈夫安迪（查德·迈克尔·墨瑞 Chad Michael Murray 饰）在佐治亚的林间买了一间小屋，可是宝贝女儿海蒂（艾米莉·艾林·林德 Emily Alyn Lind 饰）却由此声称能够看到一位名叫高迪的老人。乔希和安迪先后印证了海蒂的说法，但依赖药物的丽萨坚信这都是小女孩的臆想。在此之后，事态朝着不可预知的方向发展……\n本片取材自真实事件。©豆瓣', '/video/13.jpg', '美国', '', 2013, '0', 1377632516, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17,25', NULL, NULL, NULL),
(14, 14, '[250].剪刀手爱德华.Edward.Scissorhands.1990.BD.MiniSD-TLF.mkv', 10, '剪刀手爱德华', '', '', '', '约翰尼·德普 薇诺娜·瑞德 安东尼·迈克尔·豪尔 黛安·韦斯特', '蒂姆·波顿', '爱德华（约翰尼•戴普 饰）是一个机器人，他拥有人的心智，却有一双剪刀手，孤独地生活在古堡里，闯入古堡的化妆品推销员佩格把他带回家，让他走进了人类的世界。单纯的爱德华爱上了佩格的女儿金（薇诺娜•瑞德 饰），金也慢慢的被爱德华的善良所吸引。\n但是，一连串的意外事情让周围的人邻居对爱德华的态度从喜欢变成无法接受，爱德华痛苦地发现，他总是好心办坏事，连自己的爱人都不能拥抱，或许，他注定就不属于这个世界。©豆瓣', '/video/14.jpg', '美国', '', 1990, '0', 1377643833, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(15, 15, '[10].蝙蝠侠前传2：黑暗骑士.The.Dark.Knight.2008.BDRip.x264.AAC.miniSD-TLF.mkv', 8, '蝙蝠侠前传2：黑暗骑士', '', '', '', '克里斯蒂安·贝尔 希斯·莱杰 艾伦·艾克哈特 迈克尔·凯恩', '克里斯托弗·诺兰', '从亲眼目睹父母被人杀死的阴影中走出来的“蝙蝠侠”，经历了成长之后，已经不再是那个桀骜不的孤单英雄了。在警官吉姆·戈登和检查官哈维·登特的通力帮助下，“蝙蝠侠”无后顾之忧地继续满世界的奔波，与日益增长起来的犯罪威胁做着永无休止的争斗，而他所在的高谭市，也是进展最为明显的地方，犯罪率以一种惊人的速度持续下降着，毕竟对方是能够上天入地的“蝙蝠侠”，不借两个胆子谁还敢造次呢？不过像高谭这种科技与污秽并存的城市，平静是不可能维持太久的，果不其然，新一轮的混乱很快就席卷了整个城市，人们再一被被恐慌所笼罩着，而声称愿意为这一切负责的，自然就是所有混乱的源头以及支配者--“小丑”了。\n先不管“小丑”掀起一个又一个犯罪的狂潮的最终目的为何，他的企图都是邪恶的，所作所为更是早就危害到了高谭市民的正常生活……其中自然包括了“蝙蝠侠”身边几个非常重要的人，而他需要做的，就是将这股新的危机全部亲自用手捏得粉碎。然而在面对着这个有史以来最具针对性、最恶毒的对手时，“蝙蝠侠”却不得不从他的地下军械库里搬出每一件能够用得上的高科技武器，还得时刻纠结着为他曾经信仰的一切寻找答案。©豆瓣', '/video/15.jpg', '美国', '', 2008, '0', 1377644622, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(16, 16, '[104].不可饶恕.Unforgiven.1992.HDRip.x264.AAC.miniSD-TLF.mkv', 12, '不可饶恕', '', '', '', '克林特·伊斯特伍德 吉恩·哈克曼 摩根·弗里曼 理查德·哈里斯', '克林特·伊斯特伍德', '堪萨斯的农民威廉（克林特•伊斯特伍德 Clint Eastwood ）年轻时曾是出名的杀手和劫匪，然而当遇上了克劳迪亚后，他的生活开始彻底改变。威廉和克劳迪亚结婚生子后，洗手不干，一家人过着幸福的生活。好景不长，克劳迪亚不久故去，威廉独立带着两个儿子过着清贫宁静的生活。\n这时，该地区发生了一起牛仔醉酒殴打妓女并将其毁容的恶性事件，坏蛋警长达格特（吉恩•哈克曼 Gene Hackman 饰）只将此事草草了结，凶手仍逍遥法外。当地妓女纷纷捐钱，要求悬红1000美金请杀手来伸张正义。“思科菲尔德小子”找到威廉，要求合伙干这票买卖。为了给儿子们一个幸福富足的家庭，威廉终于答应再次出山。©豆瓣', '/video/16.jpg', '美国', '', 1992, '0', 1377646912, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(17, 17, '[超时空接触].Contact.1997.BluRay.720p.x264.AC3.2Audios-CMCT.mkv', 12, '超时空接触/接触', '', '', '', '朱迪·福斯特 马修·麦康纳 吉娜·马隆 大卫·摩斯', '罗伯特·泽米吉斯', '艾莉·爱罗维（茱迪·福斯特饰）自幼就对无线电通讯情有独钟。长大后，她成为一名天文学家，其项目内容为接收外太空信号。她希望能借此找到宇宙其他文明的存在。天才的理想得到的却是投资者的冷眼相看，幸好有神秘人帮助艾莉继续工作。\n一次偶然的机会，艾莉收到了来自织女星的频率信号，似乎证明了艾莉一直以来的工作是正确的。但这带来的不是她个人事业的成功，而是政治、社会、宗教、国家各个角度的矛盾与讨论。深陷这一切暴风中心的艾莉，更要面对与神职人士帕尔默·乔丝（马修·麦康纳饰）的感情纠葛。\n个人与世界，真相与现实，艾莉面临着远远超越学术范围的挑战。©豆瓣', '/video/17.jpg', '美国', '', 1997, '0', 1377655411, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '24', NULL, NULL, NULL),
(18, 18, 'epic.2013.1080p.web-dl.h264-publichd.mkv|publichd.EXTARS.birds.bugs.and.slugs.forest.explorer.720p.mkv|publichd.EXTRAS.bugs.of.camouflage.720p.mkv|publichd.EXTRAS.rot.rocks.720p.mkv', 12, '艾匹克/森林战士(台)/绿国奇兵(港)', '', '', '', '阿曼达·塞弗里德 乔什·哈切森 碧昂丝·诺尔斯 柯林·法瑞尔', '克里斯·韦奇', '《艾匹克》改编美国作家威廉·乔西的儿童文学《树叶人和勇敢好虫子》，故事围绕一场发生在森林中的正邪较量展开，一位小女孩发现自己来到一个神秘世界，为了拯救那个世界，她将联合一支有趣而精怪的队伍——与此同时这也是到她挽救自己现实生活办法。\n早在2006年，《冰河世纪》导演克里斯·韦奇就有意执导该片，此后因《电子世界争霸战》而与约翰·拉塞特结缘的他曾一度计划把影片交予皮克斯制作，但就在交易即将落锤之际，二十世纪福斯又回心转意，于2009年宣布正式立项，影片也定名为《树叶人》，今年5月福斯又片名改为了如今的《艾匹克》，同时还透露影片剧情将于原著略有出入。', '/video/18.jpg', '美国', '', 2013, '0', 1377655668, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '22,17', NULL, NULL, NULL),
(19, 19, 'Murder.by.Death.1976.576p.DVDRip.AC3.X264-BARC0DE.mkv', 9, '怪宴', '', '', '', '艾琳·布伦南 杜鲁门·卡波特 詹姆斯·可可 彼得·法尔克', '罗伯特·摩尔', '神秘宅邸的主人莱昂内尔·吐温（杜鲁门·卡波特 Truman Capote饰）邀请五位世界著名的侦探来到古堡出席一场神秘的晚宴。他们分别是纽约业余侦探迪克·查尔斯顿（大卫·尼文 David Niven饰），比利时侦探米洛·比埃尔（詹姆斯·可可 James Coco饰），上海检查员西德尼·王（彼得·塞勒斯 Peter Sellers饰），英国人杰西卡·马波尔（爱尔莎·兰切斯特 Elsa Lanchester饰）小姐和来自旧金山的萨姆·戴蒙德（彼得·法尔克 Peter Falk饰）。没人知道这次凶险异常的邀约背后到底隐藏着什么样的杀机，但这五位侦探们还是各自带上一位亲属或朋友来到了这座神秘的宅邸。然而莱昂内尔并没有现身，等待他们的是一连串被精心设计过的谋杀事件。\n杜鲁门·卡波特凭借本片荣获1977年第34届金球奖电影类-最佳新男演员提名。©豆瓣', '/video/19.jpg', '美国', '', 1976, '0', 1377657389, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '24,25', NULL, NULL, NULL),
(20, 20, '[月色撩人(国英双语)].Moonstruck.1987.BluRay.720p.x264.AC3-CnSCG.mkv', 10, '月色撩人/', '', '', '', '雪儿 尼古拉斯·凯奇 文森特·加迪尼亚 奥林匹亚·杜卡基斯', '诺曼·杰威森', '纽约布鲁克林，有一个意大利家庭，每到月圆之夜，他们仿佛被施了魔法，会做出一些莫名其妙的举动。雪儿（洛丽塔•卡斯托里尼 Loretta Castorini 饰）是家里的独女，年轻貌美，是公司里的会计师。因为前夫遭遇车祸，而成了寡妇。某晚，在酒馆里，洛丽塔目睹了邻桌分手的惨剧，仿佛受了刺激，决定跟41岁的单身汉强尼结婚。她让强尼用尾戒求婚，于是众目睽睽之下喜结连理。不过，因为母亲病重，强尼离开了纽约，临走时让她邀请弟弟罗尼（尼古拉斯•凯奇 Nicolas Cage 饰）参加婚礼。她去面包房见到罗尼，后者听到婚事异常激动，并讲述了反对的理由。她据理力争，他根本不听。后来，她邀请他到家里做客，希望兄弟俩冰释前嫌，却没想到在一番激烈的争吵后，他们之间的关系发生了微妙的变化……©豆瓣', '/video/20.jpg', '美国', '', 1987, '0', 1377663822, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(21, 21, '1939.Battle.of.Westerplatte.2013.720p.WEB-DL.DD5.1.H264-REDACTED.mkv', 12, '血战西盘岛', '', '', '', 'Michal Zebrowski 尼古拉斯·凯奇 文森特·加迪尼亚 奥林匹亚·杜卡基斯', 'Pawel Chochlew', '1939年的西盘半岛战役是二战初期波兰抗击纳粹德国的象征性一役，不到200名波兰士兵，阻击了将近2000德军整整七天。这部史诗巨作展现了波兰军队浴血奋战的恢宏场面，连场惊心动魄的战斗，具有超震撼的视听冲击力。而硝烟背后，波兰守军司令官苏夏尔斯基与政治员达布罗斯基之间的合作与矛盾，展示出演员飙戏的深厚功力，令人大呼过瘾，主演米乔·赞布罗斯基曾三度提名波兰“奥斯卡”最佳男演员，在片中演技炉火纯青。', '/video/21.jpg', '波兰', '', 2013, '0', 1377664851, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(22, 22, 'The.Great.Gatsby.2013.720p.BluRay.x264-SPARKS.mkv', 10, '了不起的盖茨比', '', '', '', '莱昂纳多·迪卡普里奥 凯瑞·穆里根 托比·马奎尔 艾拉·菲舍尔', '巴兹·鲁赫曼', '1922年的春天，一个想要成名名叫尼克·卡拉威（托比·马奎尔 Tobey Maguire 饰）的作家，离开了美国中西部，来到了纽约。那是一个道德感渐失，爵士乐流行，走私为王，股票飞涨的时代。为了追寻他的美国梦，他搬入纽约附近一海湾居住。他的邻居是一位经常举办派对且极具神秘色彩的百万富翁，名叫盖茨比（莱昂纳多·迪卡普里奥 Leonardo DiCaprio 饰）。海湾的对岸住着他的表亲，黛西（凯瑞·穆里根 Carey Mulligan 饰）和她那视女性为玩物的贵族丈夫，汤姆·布坎南（乔尔·埃哲顿 Joel Edgerton 饰）。自此尼克跌入了一个充满魅力的世界，这个世界充斥着富豪和他们编制的假象、爱与谎言。\n悠游于幻想、爱情和谎言世界中的尼克，决定将目睹的一切记录于文字当中，于是一段关于不可能的爱，纯洁的梦，以及时尚华丽同时又不为人知的故事一一被揭开……', '/video/22.jpg', '澳大利亚', '', 2013, '0', 1377670007, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(23, 23, 'Badges.of.Fury.2013.DVDRip.x264.AC3.WahDee.mkv', 8, '不二神探', '', '', '', '文章 李连杰 刘诗诗 陈妍希', '王子鸣', '短短几天内，电影明星、舞蹈演员、跳水冠军，三个没有任何关联的知名人士面带微笑意外死亡，在社会上引起不小的轰动。与此同时，擅长搞怪耍宝的热血青年警察王不二（文章 饰）与深藏不露的警队老油条黄飞红（李连杰 饰）搭档破案，惹出不少的乱子，令他们的上司Angela（陈妍希 饰）郁闷不已。某天，地产项目经理王峰（佟大为 饰）微笑死亡，案子交到Angela一组手中。为了尽快扭转警局中的不利局面，Angela、王不二和黄飞红展开全力追查，他们率先从与几名死者都有过交往的女演员刘金水（刘诗诗 饰）入手。而在这一过程中，妖艳鬼魅的戴依依（柳岩 饰）出现，无疑令案情朝向更为扑朔迷离的方向发展。\n最终真相如何，王不二能否立下奇功？©豆瓣', '/video/23.jpg', '中国大陆', '', 2013, '0', 1377670405, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(24, 24, 'The Supernatural Events on Campus.2013.1080p.WEB-DL.x264.AAC-XLMV.mkv', 12, '校花诡异事件', '', '', '', '赵奕欢 王一 翟文斌 孔千千', '关尔', '华西学院的校花苏苏（赵奕欢 饰）独自赴景区旅游，结果遭遇山洪暴发，不得已滞留期间。她辗转来到老旧古朴的平安旅馆。经过一番讨价还价，她决定暂且在这里待上一周。电闪雷鸣的夜晚，接二连三诡异恐怖事件，令苏苏提心吊胆，惶恐难耐。次日一早，她结识了同样被困住的理工大学生陆苗（孔千千 饰）、杨东（翟文斌 饰）以及摄影师林枫（翟文斌 饰），青年人在一起让她暂时忘却昨夜的经历，而与林枫似曾相识的感觉又让苏苏隐隐预感到一段美好缘分的开始。\n只是在这片几乎与世隔绝的荒郊野外，种种意想不到的恐怖经历交替出现，带给苏苏最难忘记的阴森记忆……©豆瓣', '/video/24.jpg', '中国大陆', '', 2013, '0', 1377670492, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '25,17', NULL, NULL, NULL),
(25, 25, 'K-PAX.2001.720p.Dtheater.DTS.x264-DON.mkv', 12, '[Nexus].K-PAX.torrent', '', '', '', '凯文·史派西 杰夫·布里吉斯 玛丽·麦克科马克 阿尔法·伍达德', 'Iain Softley', '一位自称普洛特的戴墨镜男人（凯文•斯帕西 Keven Spacey 饰）突然出现在纽约中央公园车站。他自称来自天琴座附近距地球一千光年的K-PAX星，以超光速来到地球考察。普洛特被当作精神病人入住曼哈顿精神病院，受到马克•鲍威尔医生（杰夫•布里奇斯 Jeff Bridges 饰）的治疗。马克认为普洛特是妄想症患者，却又对普洛特的奇怪行为和不可思议的天文知识将信将疑。同时，普洛特的到来在病院中其他病人中造成轰动，人人都希望能被选中随普洛特回K-PAX星。马克医生竭尽全力希望找出普洛特的真实身份，却没想到自己竟在此过程中越来越被普洛特的理论所说服。普洛特的真实身份究竟为何？\n本片被提名美国科幻、幻想和恐怖电影协会最佳男主角（凯文•斯帕西）。©豆瓣', '/video/25.jpg', '美国', '', 2001, '0', 1377674083, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '24', NULL, NULL, NULL),
(26, 26, 'Short.Circuit.1986.BluRay.720p.DTS.2Audio.x264-HDS.mkv', 9, '霹雳五号', '', '', '', '斯蒂夫·古根伯格 艾丽·西蒂 费舍·史蒂芬斯 阿尔法·伍达德', '约翰·班德汉姆', '《霹雳五号》是1986年由新力影业旗下子公司——三星影业所推出的科幻喜剧片。\nNOVA军火公司开发了五台战争用机器人，而其中一台机器人“No.5”有一天突然被雷打中，而之后便产生了自我意识，并且开始自称自己为“强尼五号”。它逃到了街上，却被人类视为一大威胁，而剩下四台机器人也在追杀它，它必须设法说服发明它的科学家“自己是一种生命，而不是战争用机器人”。在一次短路状况下闯入了热心保护动物的史蒂芬妮家中，并从与人交往的过程中学习到人类的智慧的人性，后来拒绝回到武器公司充当他们的杀人工具。©豆瓣', '/video/26.jpg', '美国', '', 1986, '0', 1377678614, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(27, 27, 'The.Iceman.2012.720p.BluRay.x264.AC3-HDWinG.mkv', 12, '冰人/送冰的人/急冻杀手(台)', '', '', '', '迈克尔·珊农 克里斯·埃文斯 薇诺娜·瑞德 雷·利奥塔', 'Ariel Vromen', '职业杀手Richard Kuklinski，一生杀了100多人，他经常将受害人的尸体冻成冰以掩盖死亡时间，江湖人称“冰人”，他有职业操守，不杀女人和小孩。另一方面，他是个顾家的好男人，他的家庭从不知道他的阴暗身份。生活中这个温柔绅士的好男人，深爱着他美丽的妻子和两个可爱的女儿。可秘密从来都不是个轻松的事情，直到真相大白的一天，保守秘密者注定要背着秘密艰难前行：凶残的杀手身份和对家人深沉浓烈的爱让这个“冰人”整日处在灵魂的挣扎中。', '/video/27.jpg', '美国', '', 2012, '0', 1377685670, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '25,26', NULL, NULL, NULL),
(28, 28, '[完美的世界].A.Perfect.World.1993.BluRay.720p.x264.AC3.2Audios-CMCT.mkv', 12, '完美的世界/强盗保镖', '', '', '', '凯文·科斯特纳 劳拉·邓恩 克林特·伊斯特伍德 T·J·劳瑟', '克林特·伊斯特伍德', '单亲孩子菲利普·佩里（T·J·劳瑟 T.J. Lowther 饰）的母亲对他管教甚严，8岁的小菲利普甚至从未参加过一次鬼节讨糖果的游戏。附近州监狱的两名罪犯越狱成功，劫持了菲利普作为人质，向德州边界逃窜。途中，罪犯之一的布奇（凯文·科斯特纳 Kevin Costner 饰）干掉了鲁莽愚蠢的同伙，却对小菲利普照顾有佳。与此同时，德州警探瑞德（克林特·伊斯特伍德 Clint Eastwood 饰）带着手下和州长特派的犯罪专家萨利（劳拉·邓恩 Laura Dern 饰）一同火速追捕布奇。双方在德克萨斯州境内展开了一场公路赛大竞技；而小菲利普也经历了很多从未想过过的刺激与快乐，并与布奇产生了一种近似父子的不寻常感情……©豆瓣', '/video/28.jpg', '美国', '', 1993, '0', 1377686852, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26,25', NULL, NULL, NULL),
(29, 29, 'The.Story.of.Qiu.Ju.1992.720p.BluRay.x264-WiKi.Sample.mkv|The.Story.of.Qiu.Ju.1992.720p.BluRay.x264-WiKi.mkv', 12, '秋菊打官司', '', '', '', '巩俐 刘佩琦 雷恪生 戈治均', '张艺谋', '中国西北某个小山村里，村妇秋菊（巩俐）的丈夫王庆来（刘佩琦）在与村长争执时被对方踢伤下体无法再干农活，只能整日躺在床上，对此村长没表一态。秋菊气不过，找村长理论不得对方理会，为讨一口气，她一纸诉状将村长告到了乡政府。乡政府李公安耐心调解一番后，村长答应赔偿秋菊家的经济损失，却是把钞票直接扔在地上拒不道歉。\n村长的举动虽蛮横无理，众人还是觉得事情可以就此划上句号，唯独秋菊被激怒，立誓要讨个说法，于是她挺着个大肚子和妹妹来到县城，开始了漫漫告状路。©豆瓣', '/video/29.jpg', '中国大陆', '', 1992, '0', 1377687673, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(30, 30, 'Letters.from.Iwo.Jima.2006.720p.BluRay.x264-WiKi.mkv|Letters.from.Iwo.Jima.2006.720p.BluRay.x264-WiKi.Sample.mkv', 12, '硫磺岛家书/硫磺岛的来信', '', '', '', '渡边谦 二宫和也 加濑亮 中村狮童', '克林特·伊斯特伍德', '中途岛战役失利直接宣布了日军在太平洋战场上的失败，负隅顽抗的日军依然坚守日本最南端的小岛—硫磺岛。这个看似不起眼的小岛，却上演了二战太平洋上最惨烈的战争。\n栗林忠道中将（渡边谦 饰）是日军在硫磺岛的指挥官，负责这道日军最后的防线。栗林中将大力改革日军内部的陋习和不足，并设计出一整套对付美军、以拖延为主的作战方案。虽然他和日军的二万名官兵都上下齐心，但面对占尽空中优势的四万名美军士兵，栗林知道这将是一场没有归路的战争。\n在最后的战争之前，栗林写下了他最后的家书……©豆瓣', '/video/30.jpg', '美国', '', 2006, '0', 1377688558, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(31, 31, 'Yellow.Elephant.2013.720p.BluRay.x264-WiKi.mkv|Yellow.Elephant.2013.720p.BluRay.x264-WiKi.Sample.mkv', 12, '黄色大象', '', '', '', '宫崎葵 向井理 滨田龙臣 浅見姫香', '广木隆一', '在一个远离城市喧嚣的宁静山村，生活着一对年轻夫妇，身为小说家的丈夫无辜步（向井理 饰）以及他的妻子妻利爱子（宫崎葵 饰）。妻天真纯洁，童年时代大部分都在医院里度过，《黄色大象》的绘本曾为她带来无限的快乐，直到如今妻似乎都一直拥有着和动物、植物交流的能力。他们的结合从最初便遭到妻父母的反对，虽则如此，隐居山野的理想生活令人欣羡，快乐无忧，与村人邻里互帮互助，友爱通达。只不过，妻的身体似乎慢慢发生变化，她的情绪也变得愈加不稳定。深藏心底的秘密使幸福的二人世界出现了不安定的因素……\n本片根据女性作家西加奈子的原著改编。©豆瓣', '/video/31.jpg', '日本', '', 2013, '0', 1377689966, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(32, 32, '[42].阿拉伯的劳伦斯.Lawrence.of.Arabia.1962.HDTV.MiniSD-TLF.mkv', 12, '阿拉伯的劳伦斯', '', '', '', '彼得·奥图尔 奥马尔·沙里夫 安东尼·奎恩 亚利克·基尼斯', '大卫·里恩', '一战爆发后，德国盟友土耳其趁机侵入阿拉伯半岛。英国军方派陆军情报军官劳伦斯（彼得•奥图 Peter O’Toole 饰）去阿拉伯各部活动，试图发现部族首领费萨尔王子（亚历克•吉尼斯 Alec Guiness 饰）的最终政治企图。劳伦斯在途中结识了哈里苏部族首领阿里（奥玛•雪瑞夫 Omar Sharif 饰），并奉费萨尔王子之命与阿里率突击队穿过纳夫德沙漠奇袭亚喀巴城，途中还取得哈维塔特部族首领奥达（安东尼•奎恩 Anthony Quinn 饰）的信任。胜利后劳伦斯换上阿拉伦人服装，与阿里带领游击队开展针对土耳其的炸毁铁路的恐怖活动，威震中东；却没想到自己的命运却从此扭转直下……\n本片获1962年第35界奥斯卡最佳影片，最佳导演（大卫•利恩David Lean），最佳艺术指导，最佳摄影，最佳原创音乐，最佳剪辑和最佳音效共七项大奖，并获奥斯卡最佳男主角（彼得•奥图），最佳男配角（奥玛•雪瑞夫）和最佳改编剧本三项提名。©豆瓣', '/video/32.jpg', '英国', '', 1962, '0', 1377705848, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '31', NULL, NULL, NULL),
(33, 33, '[137].野战排.Platoon.1986.HDTVRip.x264.AAC.HALFCD-TLF.mkv', 8, '野战排', '', '', '', '威廉·达福 查理·辛 汤姆·贝伦杰 凯斯·大卫', '奥利佛·斯通', '泰勒（查理•辛 Charlie Sheen 饰）是越战期间的一名美国大学生，他前往越南前线去服兵役，被分到了一个步兵部队。部队里有两个人一直对他影响颇大——伊莱亚斯（威廉•达福 Willem Dafoe 饰）和巴恩斯（汤姆•贝伦杰 Tom Berenger 饰）。他们两人对战争的看法截然不同，前者不忍残杀无辜，而后者却杀人如麻，泰勒心里非常迷惑，到底谁对战争的看法才是正确。\n巴恩斯展开了一场残忍的屠杀，越南整条村落都流血成河。伊莱亚斯力劝好友不要如此残暴，却遭致二人关系的裂缝。巴恩斯更怀疑伊莱亚斯向上司打小报告，友谊变为妒恨。于是，在一次丛林战争中，他背着所有人，向伊莱亚斯扣下了扳机。\n泰勒却洞察了这一切，他心里终于有了答案。©豆瓣', '/video/33.jpg', '美国', '', 1986, '0', 1377706840, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(34, 34, '[7].十二怒汉.12.Angry.Men.1957.DVD9.x264.AAC.miniSD-TLF.mkv', 12, '十二怒汉', '', '', '', '亨利·方达 李·科布 罗伯特·韦伯 杰克·克卢格曼 ', '西德尼·吕美特', '一个在贫民窟长大的18岁少年因为杀害自己的父亲被告上法庭，证人言之凿凿，各方面的证据都对他极为不利。十二个不同职业的人组成了这个案件的陪审团，他们要在休息室达成一致的意见，裁定少年是否有罪，如果罪名成立，少年将会被判处死刑。\n十二个陪审团成员各有不同，除了8号陪审员（Henry Fonda 饰）之外，其他人对这个犯罪事实如此清晰的案子不屑一顾，还没有开始讨论就认定了少年有罪。8号陪审员提出了自己的“合理疑点”，耐心地说服其他的陪审员，在这个过程中，他们每个人不同的人生观也在冲突和较量……©豆瓣', '/video/34.jpg', '美国', '', 1957, '0', 1377707284, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(35, 35, '[141].荒野生存.Into.the.Wild.2007.HDRip.x264.AAC.miniSD-TLF.mkv', 12, '荒野生存', '', '', '', '埃米尔·赫斯基 马西娅·盖伊·哈登 克里斯汀·斯图尔特 文斯·沃恩', '西恩·潘', '影片改编自真实的故事，展现了一个理想主义者的传奇，一个流浪的故事。\n克里斯托弗（埃米尔•赫斯基 饰）家境优渥，是亚特兰大私立名校艾莫里的优等生，前程似锦。但是，他从学校毕业后，选择了截然不同的人生，放弃令人羡慕的工作，把存款捐给慈善机构，去阿拉斯加寻找自我。在家人的劝阻声中，他踏上了回归自然的慢慢长路，成为名副其实的流浪者。\n一路上，他遇到不少人，也数次遭受野外生存的挑战，每一步都充满了艰辛，他以坚韧的毅力，实践着寻找自我的梦想……©豆瓣', '/video/35.jpg', '美国', '', 2007, '0', 1377707718, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17,31', NULL, NULL, NULL),
(36, 36, '[158].乱世佳人(全屏版).Gone.with.the.Wind.1939.BDRip.2Audio.MiniSD-TLF.mkv', 10, '乱世佳人(全屏版)', '', '', '', '克拉克·盖博 费雯·丽 托马斯·米切尔 海蒂·麦克丹尼尔斯', '维克多·弗莱明', '美国南北战争前夕，南方农场塔拉庄园的千金斯嘉丽（费•雯丽 饰）爱上了另一个农场主的儿子艾希礼（李斯利•霍华德 饰），遭到了拒绝，为了报复，她嫁给了自己不爱的男人，艾希礼妻子梅兰（奥莉薇•黛•哈佛兰 饰）的弟弟查尔斯。\n战争期间，斯嘉丽成为寡妇，失去母亲，挑起生活的重担，不再是当初的千金小姐；战争结束后，她又两度为人妻，嫁给了爱她多年的投机商人瑞德（克拉克•盖博 饰）。\n然而，纵使经历了生活的艰苦，斯嘉丽对艾希礼的感情仍然没有改变。艾希礼妻子梅兰的去世，给了斯嘉丽一个机会，一边是深爱自己的丈夫瑞德，一边是心心念念多年的艾希礼？斯嘉丽会给自己怎样一个不一样的明天？©豆瓣', '/video/36.jpg', '美国', '', 1939, '0', 1377709206, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(37, 37, '[60].梦之安魂曲.Requiem.for.a.Dream.2000.BDRip.x264.AAC.miniSD-TLF.mkv', 12, '梦之安魂曲', '', '', '', '艾伦·伯斯汀 杰瑞德·莱托 詹妮弗·康纳利 马龙·韦恩斯', '达伦·阿伦诺夫斯基', '哈瑞(贾里德-莱托饰)和玛丽安(珍妮弗-康奈利饰)彼此相爱，梦想着开个服装店，梦想着有个美好的明天。然而他们都离不开毒品，并想着以销毒赚得第一桶金。哈瑞的母亲是个彻底的电视迷，最大的梦想是上电视，为此不顾年迈吞食减肥药。由于药品里的毒品成分，她渐渐上了瘾。哈瑞的朋友狄龙(马龙-瓦延斯饰)同样是个瘾君子，为了挣大钱加入了黑社会。为了梦想，他们努力着，却一步步深陷毒品难以自拔。\n哈瑞的胳膊因注射毒品感染而被割去；玛丽安为了毒品出卖肉体和自尊；哈瑞的母亲最终住进了精神病院受尽折磨；狄龙锒铛入狱。当视线变得模糊，梦在遥远处呼唤，迷失的人该以怎样的姿态安抚自己的灵魂。©豆瓣', '/video/37.jpg', '美国', '', 2000, '0', 1377709687, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(38, 38, '[166].热天午后.Dog.Day.Afternoon.1975.BD.MiniSD-TLF.mkv', 9, '热天午后', '', '', '', '阿尔·帕西诺 约翰·凯泽尔 查尔斯·德恩 克里斯·萨兰登', '西德尼·吕美特', '根据真实故事改编，美国历史上最不完善的银行抢案。\n本该是10分钟完成的银行抢劫犯罪，却变成了12小时的拉锯战。桑尼（阿尔·帕西诺饰）算是美国历史上最倒霉的银行抢劫犯了。一个盛夏的下午，桑尼与同伴塞勒（约翰·卡扎雷饰）闯入纽约市布鲁克林银行，准备实施抢劫。怎奈银行刚刚完成交易，金库内根本没有现钱。倒霉的桑尼与塞勒转而劫持人质，与警方对峙提出要求。但4小时后，劫案现场被围观群众和手忙脚乱的警察弄得像游乐园一样热闹。桑尼走出银行对警察的质问居然赢得了群众的喝彩。8小时后，银行劫案登上了电视节目的实况转播，大家仿佛拍电影一样高兴。而这时夜色降临，人质亦出现了斯德哥尔摩症候群，究竟这场闹剧将以什么方式结束？©豆瓣', '/video/38.jpg', '美国', '', 1975, '0', 1377709761, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(39, 39, '[19].夺宝奇兵.Indiana.Jones.And.The.Raiders.Of.The.Lost.Ark.1981.HDTV.MiniSD-TLF.mkv', 8, '夺宝奇兵', '', '', '', '哈里森·福特 凯伦·阿兰 保罗·弗里曼 约翰·瑞斯-戴维斯', '史蒂文·斯皮尔伯格', '二战期间，希特勒在世界各地召集考古学家寻找“失落的约柜”——圣经中引导希伯来人与上帝交流的圣物，希特勒欲借其来护佑纳粹的战争。\n为了使希特勒的计划破灭，印第安纳琼斯博士（Harrison Ford饰）奔赴尼泊尔，一边奋力挖掘蛛丝马迹，一边还要与无孔不入的纳粹分子周旋。凭借着过人的智慧和异于常人的胆量及大无畏的勇气，琼斯终于在罗马找到了指示约柜位置的太阳手杖，继而发现了约柜。\n就在大功告成之际，纳粹军却侵吞了胜利果实，还将琼斯等人留在了蛇穴里！但是无往不胜的琼斯总是有办法死里逃生，并狠狠地还以颜色！©豆瓣', '/video/39.jpg', '美国', '', 1981, '0', 1377709793, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17', NULL, NULL, NULL),
(40, 40, '[100].角斗士.Gladiator.2000.BD.MiniSD-TLF.mkv', 8, '角斗士', '', '', '', '罗素·克劳 杰昆·菲尼克斯 康妮·尼尔森 理查德·哈里斯', '雷德利·斯科特', '马克西·蒙斯（罗素·克劳 饰）是罗马帝国战功显赫，受人拥戴的大将军。老国王马库斯·奥利利乌斯（理查德·哈里斯 饰）对大将军赏识有加，有意加冕于他。老国王对将军这种超越亲情的宠爱自然招来太子康莫迪乌斯的妒忌与不安，太子伺机杀害父亲，抢先登上王位，并马上下令诛杀大将军一家。\n马克西蒙斯死里逃生躲过暴君的魔爪，可是他所有的家人都未能幸免于难，返回家园，他只看到满目疮痍的破败景象。走投无路的马克西蒙斯只能投身为奴，从昔日的大将军沦为一名角斗士，在血腥厮杀中苟且求生。\n凭借英勇的气魄和高超的武艺，马克西蒙斯渐渐脱颖而出，晋级到罗马的大角斗场。这一次，他的剑直指暴君康莫迪乌斯，失去亲人的痛苦，沦为奴隶的屈辱，在马克西蒙斯的内心燃起了熊熊怒火。©豆瓣', '/video/40.jpg', '英国', '', 2000, '0', 1377710604, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17', NULL, NULL, NULL);
INSERT INTO `eku122x_video` (`id`, `nexusphp`, `videoname`, `cid`, `title`, `intro`, `keywords`, `color`, `actor`, `director`, `content`, `picurl`, `area`, `language`, `year`, `serial`, `addtime`, `hits`, `monthhits`, `weekhits`, `dayhits`, `hitstime`, `stars`, `status`, `up`, `down`, `playurl`, `downurl`, `inputer`, `reurl`, `letter`, `score`, `scoreer`, `genuine`, `vodplay`, `stype_mcid`, `selftitle`, `selfkeywords`, `selfdescription`) VALUES
(41, 41, '[79].摩登时代.Modern.Times.1936.D5.MiniSD-TLF.mkv', 10, '摩登时代', '', '', '', '查理·卓别林 宝莲·高黛 亨利·伯格曼 Tiny Sandford', '查理·卓别林', '二十年代的美国处于经济萧条时期，失业率居高不下，工人受尽压榨，成为了大机器生产中的一颗螺丝钉。查理（查理·卓别林 Charles Chaplin 饰）就是一个底层市民，他在一个机器隆隆的厂房里日以继夜地工作，以赚取微薄的收入。重复繁重的工作压得他喘不过气，他把人们的鼻子当成螺丝钉来拧，卷入流水线机器的皮带里，令人苦笑不得。\n查理尽管贫穷，但却很善良。他在路上搭救了流浪女，和她一起生活，家里破烂却又温馨。每次身无分文的查理为了找到吃的，都会故意犯事，以便进入监牢。光景一时间有了好转，流浪女成了歌舞红星，然而好景太短暂了。©豆瓣', '/video/41.jpg', '美国', '', 1936, '0', 1377712319, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(42, 42, '[88].美国往事.Once.Upon.A.Time.In.America.1984.HDTVRip.x264.AAC.miniSD-TLF.mkv', 12, '美国往事', '', '', '', '罗伯特·德尼罗 詹姆斯·伍兹 詹妮弗·康纳利 伊丽莎白·麦戈文', '赛尔乔·莱翁内', '二十年代的美国，纽约少年“面条”（罗伯特•德尼罗 饰）和几个同龄朋友一起认识了聪明狡黠的“麦大”（詹姆斯 • 伍兹 饰），他们开始从事走私活动。不久，面条在一场械斗中杀伤人命，被关进监牢。\n若干年后，“面条”出狱，当时的小伙伴们已经变成了健壮的青年人，在“麦大”的带领下，他们开始了一系列抢劫、盗窃、敲诈活动。随着犯罪活动的不断深入，“麦大”似乎被胜利冲昏了头脑，竟然把美国联邦储备银行也列入了行动目标。“面条”不忍眼看好友走向毁灭，偷偷打电话报警，想逼迫“麦大”收手。警察与“面条”的朋友展开激烈枪战，“麦大”等人全部被杀。“面条”带着深深的悔恨和痛苦，离开纽约，回到年少时生长的地方。\n三十五年过去了，几近垂暮的“面条”重新回到纽约的伤心地，他遇见了少时的朋友和旧情人，而当年“麦大”他们的死，背后竟然包含着出乎意料的阴谋。©豆瓣', '/video/42.jpg', '意大利', '', 1984, '0', 1377712925, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '26', NULL, NULL, NULL),
(43, 43, '[222].本杰明·巴顿奇事.The.Curious.Case.of.Benjamin.Button.2008.BDRip.MiniSD-TLF.mkv', 10, '本杰明·巴顿奇事', '', '', '', '布拉德·皮特 凯特·布兰切特 塔拉吉·P·汉森 蒂尔达·斯文顿', '大卫·芬奇', '飓风正在侵袭美国新奥尔良，一位病危的老妇睁开了她的睡眼。老妇名叫戴茜（凯特·布兰切特饰），她叫女儿凯若琳（朱莉娅•奥蒙德饰）为她阅读一本日记。这本日记的作者叫本杰明•巴顿（布拉德•皮特饰）。本杰明出生在第一次世界大战停战之时，但生来便像个老人的他被父亲当作怪物，被遗弃在了养老院。本杰明在养老院与老人们一起生活。但谁都没有想到，本杰明逆向发育——越活越年轻！也许“越活越年轻”是某些人的梦想，但真正这样成长的本杰明却有了别人无法理解的烦恼与快乐。穿越半世纪的世界变革，本杰明身处其中，感受别人感受不到的感受。\n为何母亲会让自己念这本日记？本杰明•巴顿此人与母亲有什么关系？凯若琳陷入了深深的疑惑与好奇之中。©豆瓣', '/video/43.jpg', '美国', '', 2008, '0', 1377713124, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '24', NULL, NULL, NULL),
(44, 44, '[8].飞越疯人院.One.Flew.Over.The.Cuckoos.Nest.1975.BDRip.X264.AAC.miniSD-TLF.mkv', 12, '飞越疯人院', '', '', '', '杰克·尼科尔森 丹尼·德维托 克里斯托弗·洛伊德 路易丝·弗莱彻', '米洛斯·福尔曼', '麦克墨菲（杰克·尼科尔森 Jack Nicholson 饰）为了逃避监狱里的强制劳动，装作精神异常，被送进了精神病院，他的到来，给死气沉沉的精神病院带来了剧烈的冲击。\n麦克要求看棒球比赛的电视转播，挑战了医院严格的管理制度，受到护士长瑞秋（路易丝·弗莱彻 Louise Fletcher 饰）的百般阻挠；麦克带领病人出海捕鱼，振奋了 他们的精神，却让院方头痛不已。院方为了惩处麦克胆大妄为、屡犯院规，决定将他永远留在疯人院。生性自由的麦克再也无法忍受疯人院的生活，他联合病友，高大的印第安人“酋长”，开始自己的计划：飞越疯人院。\n本片获1975年第48届奥斯卡最佳影片，最佳男、女主角，最佳导演和最佳改编剧本五项大奖。主人公“不自由毋宁死”的精神在当今社会仍有很大的现实意义。©豆瓣', '/video/44.jpg', '美国', '', 1975, '0', 1377713166, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(45, 45, '[157].玩具总动员.Toy.Story.1995.BD.3Audio.MiniSD-TLF.mkv', 9, '玩具总动员', '', '', '', '汤姆·汉克斯 蒂姆·艾伦 唐·里克斯 吉姆·法尼', '约翰·拉塞特', '小主人家境富裕，拥有一屋的玩具。其中他最爱的是牛仔玩偶胡迪，胡迪因此成为众玩具的“老大”。当小主人出门在外时，一屋的玩具自成世界，过着自己的生活。一天，小主人带回了一个新的玩意：太空战警巴斯光年。巴斯光年长相新奇，功能先进，令小主人爱不释手，威胁到了胡迪的地位。胡迪千方百计要赶走巴斯，一不小心二人一起掉出了房间窗口外，邻居的恶狗在狂吠，邻居的小孩是一个玩具虐待狂，胡迪巴斯能不能化敌为友，消灾解难？©豆瓣', '/video/45.jpg', '美国', '', 1995, '0', 1377713168, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '22', NULL, NULL, NULL),
(46, 46, '[53].异形2.Aliens.II.1986.HDTV.MiniSD-TLF.mkv', 8, '异形2', '', '', '', '西格妮·韦弗 凯莉·赫恩 迈克尔·比恩 兰斯·亨利克森', '詹姆斯·卡梅隆', '蕾普莉（西格妮•韦弗 Sigourney Weaver　饰）是首次探险任务遇到异形后的唯一生还者，她一直冬眠直到被救援队救回地球。当她睁开眼睛后，才发现自己已经冬眠了57年！\n期间，人类已经移居到了异形所在的星球。蕾普莉知道后，马上向当局报局该星球上异形的情况，但却被当局认为要么精神不正常，要么谎话连篇。蕾普莉见当局对她的说话不予理睬，便决心不再涉足和异形有关的任何事。\n果不其然，在那个异形所在的那个星球上定居的人忽然和地球中断了联系。这时当局才注意到蕾普莉之前汇报的情况，决定派出军队去营救。蕾普莉被说服参与营救行动。\n又一场腥风血雨的战斗展开了！©豆瓣', '/video/46.jpg', '美国', '', 1986, '0', 1377714025, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '25', NULL, NULL, NULL),
(47, 47, '[220].鸭羹.Duck.Soup.1933.D5.MiniSD-TLF.mkv', 9, '鸭羹', '', '', '', '格劳乔·马克斯 哈勃·马克斯 奇科·马克斯 泽伯·马克斯', '莱奥·麦卡雷', 'Freedonia国家财政陷入困难，有钱的寡妇Mrs. Teasdale（玛格丽特·杜蒙 Margaret Dumont 饰）推荐Rufus T. Firefly （格劳乔·马克斯 Groucho Marx 饰）出任国家领袖，她才答应出资资助国家。Freedonia的邻国Sylvania想要对其发起进攻，Sylvania的大使Trentino于是派出了两名间谍Chicolini（奇科·马克斯 Chico Marx饰）和Pinky（哈勃·马克斯 Harpo Marx饰）去刺探Firefly的情报。然而这两个不专业的间谍却闹出了不少笑话。Firefly的秘书Bob Roland （泽伯·马克斯 Zeppo Marx 饰）让Firefly多加小心，然而昏庸的Firefly并没有放在心上，随着他和大使Trentino的矛盾越来越大，战争终于无可避免.....©豆瓣', '/video/47.jpg', '美国', '', 1933, '0', 1377720681, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '', NULL, NULL, NULL),
(48, 48, '[78].[阿凡达].Avatar.2009.BDRip.X264.2Audio.MiniSD-TLF.mkv', 11, '[阿凡达', '', '', '', '萨姆·沃辛顿 佐伊·索尔达娜 西格妮·韦弗 史蒂芬·朗', '詹姆斯·卡梅隆', '战斗中负伤而下身瘫痪的前海军战士杰克•萨利（萨姆•沃辛顿 Sam Worthington 饰）决定替死去的同胞哥哥来到潘多拉星操纵格蕾丝博士（西格妮•韦弗 Sigourney Weaver 饰）用人类基因与当地纳美部族基因结合创造出的 “阿凡达” 混血生物。杰克的目的是打入纳美部落，外交说服他们自愿离开世代居住的家园，从而SecFor公司可砍伐殆尽该地区的原始森林，开采地下昂贵的“不可得”矿。在探索潘多拉星的过程中，杰克遇到了纳美部落的公主娜蒂瑞（佐伊•索尔达娜 Zoe Saldana 饰），向她学习了纳美人的生存技能与对待自然的态度。与此同时，SecFor公司的经理和军方代表上校迈尔斯（史蒂芬•朗 Stephen Lang 饰）逐渐丧失耐心，决定诉诸武力驱赶纳美人……\n本片采用3D技术拍摄，共耗资5亿美元制作发行，是电影史上最为昂贵的作品。本片荣获第82届奥斯卡最佳摄影、最佳视觉效果、最佳艺术指导等3项大奖。©豆瓣', '/video/48.jpg', '美国', '', 2009, '0', 1377728891, 0, 0, 0, 0, 0, 0, 1, 0, 0, '第一集', '', '', '', '', 0.0, 0, 0, 'v6', '17', NULL, NULL, NULL);
